The present phase of the project is formulated to maintain the technical cooperation between MUON and UNDP with the following objectives: 
1. Al-Medina Urban Observatory Network (MUON) establishment process evaluated; 
2. The yearly report of Al- Medina status (City Profile) produced and maintained; 
3. Qualitative background studies conducted through analysis of the urban indicators in the areas of architectural, social, economic and human development;
4. Socio-economic development promoted in rural areas; and
5. In-depth studies and analyses conducted on the local economy with production of the relevant measurement indicators.
